import React from "react";

import { Link } from "react-router-dom";
let counter = 0;
function nextSlide() {
    counter++;
    console.log(counter);
    switch (counter) {
        case 1:
            document.getElementsByClassName('firstImage')[0].style.display = 'none';
            document.getElementsByClassName('secondImage')[0].style.display = 'flex';
            break;
        case 2:
            document.getElementsByClassName('firstImage')[0].style.display = 'none';
            document.getElementsByClassName('secondImage')[0].style.display = 'none';
            document.getElementsByClassName('thirdImage')[0].style.display = 'flex';
            break;
        default:
            alert("You've reached maximum");
            counter--;
    }
}
function prevSlide() {
    counter--;
    console.log(counter);
    switch (counter) {
        case 0:
            document.getElementsByClassName('firstImage')[0].style.display = 'flex';
            document.getElementsByClassName('secondImage')[0].style.display = 'none';
            document.getElementsByClassName('thirdImage')[0].style.display = 'none';
            break;
        case 1:
            document.getElementsByClassName('firstImage')[0].style.display = 'none';
            document.getElementsByClassName('secondImage')[0].style.display = 'flex';
            document.getElementsByClassName('thirdImage')[0].style.display = 'none';
            break;
        case 2:
            document.getElementsByClassName('firstImage')[0].style.display = 'none';
            document.getElementsByClassName('secondImage')[0].style.display = 'none';
            document.getElementsByClassName('thirdImage')[0].style.display = 'flex';
            break;
        default:
            alert("You've reached minimum");
            counter++;
    }
}

const home = () => {
    return (

        <><header>
            <div class="logo">

                <img src="logo.png" onclick="gotoSearch();" width="60" height="60px" />

            </div>
            <div class="menu">
                <ul>
                    <li>
                        <Link to="/Search" class="text">Поиск</Link>
                    </li>
                    <li>
                        <Link to="/Register" class="text">Регистрация</Link>
                    </li>
                    <li>
                        <Link to="Cabinet" class="text">Личный кабинет</Link>
                    </li>
                    <li>
                        <Link to="Add" class="text">Добавить</Link>
                    </li>
                    <li>
                        <Link to="Feedback" class="text">Отзывы</Link>
                    </li>
                </ul>
            </div>
        </header>



            <div class="firstImage">
                <span>pena</span>
                <a class="prev" onclick="prevSlide()">&#10094;</a>
                <a class="next" onclick="nextSlide()">&#10095;</a>
                <img src="slide1.jpg"/>
             </div>

                <div class="secondImage">
                    <span>pena</span>
                    <a class="prev" onclick="prevSlide()">&#10094;</a>
                    <a class="next" onclick="nextSlide()">&#10095;</a>
                    <img src="slide2.png"/>
             </div>

                    <div class="thirdImage">
                        <span>pena</span>
                        <a class="prev" onclick="prevSlide()">&#10094;</a>
                        <a class="next" onclick="nextSlide()">&#10095;</a>
                        <img src="slide3.png"/>
            </div>


           




        </>
    );
};

export default home;
